import { useState } from "react";
import "./App.css";

function App() {
  const [data, setData] = useState();

  const onSubmit = (e) => {
    e.preventDefault();
    fetch("http://localhost:7000/randomphonenumbers", {
      method: "get",
      mode: "no-cors",
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then((response) => response)
      .then((res) => setData(res.text()));
  };
  console.log(data);
  return (
    <div className="App">
      <header className="App-header">
        <h1>Filtro para buscar telefonos</h1>
        <form onSubmit={onSubmit}>
          <label>Telefono: </label>
          <input type="number" />
          <input type="submit" />
        </form>
      </header>
    </div>
  );
}

export default App;
